GREEN='\033[0;32m'
RED='\033[0;31m'
RESET='\033[0m'
BOLD='\033[1m'

set_color () {
	if [ "$1" == "OK" ]
	then
		COLOR=$GREEN
	else
		COLOR=$RED
	fi
}

