echo "\n$BOLD Testing random lists $RESET\n\n"

test (){
	TEST="OK"
	for (( i=0; i<$1;i++))
	do
		ARG=$(./random.sh $2)
		check=$(./push_swap $ARG | ./checker_Mac $ARG)
		if [ "$check" == "KO" ]
		then
			TEST="KO"
			echo "For lists of size $2 somethign went wrong with list\n$ARG\n\n" >> result
		fi
	done;
	set_color $TEST
	echo "$COLOR $TEST $RESET"

}

test $1 10
test $1 100
test $1 500
test $(( $1 / 2 )) 1000
for (( i=0; i<50;i++))
do
	AMOUNT=$(jot -r 1 1 1000)
	test 50 $AMOUNT
done;

echo "\n$BOLD Testing random lists 3, 5, 100 and 500 for max moves$RESET\n\n"

MAX_OPERATIONS=0
for (( i=0; i<$1;i++))
do
	ARG=$(./random.sh 3)
	if [ "$ARG" = "wrong" ]
	then
		continue
	else
		OPERATIONS=$(./push_swap $ARG | wc -l)
		if [[ "$(($OPERATIONS))" > "$(($MAX_OPERATIONS))" ]]
		then
			MAX_OPERATIONS=$OPERATIONS
			MAX_ARG=$ARG
		fi
	fi
done;
echo "For lists of size 3 after $1 tests the max operations are : $MAX_OPERATIONS"
echo "For lists of size 3 after $1 tests the max operations are : $MAX_OPERATIONS" >> result
